  false,\n\t\"url\": null,\n\t\"notes\": \"The Color Shaded Relief of Alaska map layer
  is a 100-meter resolution color-sliced elevation image of Alaska, with relief shading
  added to accentuate terrain features, in an Albers Equal-Area Conic projection.
  The image was produced by combining the 100-meter resolution color-sliced elevation
  and the grayscale shaded relief data sets that are distributed by the National Atlas
  of the United States. The color shaded relief data were derived from the National
  Atlas 100-meter resolution elevation data. The elevation data were derived from
  National Elevation Dataset (NED) data and show the terrain of the conterminous United
  States at a resolution of 100 meters. The NED is a raster product assembled by the
  U.S. Geological Survey, designed to provide national elevation data in a seamless
  form with a consistent datum, elevation unit, and projection. Data corrections made
  in the NED assembly process minimize artifacts, permit edge matching, and fill sliver
  areas of missing data. More information on NED can be found at <http://ned.usgs.gov>.\",\n\t\"license_title\":
